pragma solidity ^0.8.0;

//para utilizar los nodos de chainlink que calculan el precio 

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol"; 

contract FundMe {

/* 
    What is reverting?
    Se deshace cualquier accion de antes (igualar numero a 5) y se devuelve el gas que no se ha
    utilizado para hacer las acciones que venian despues del require
*/

    uint public number;
    uint public minimumUsd = 50 * 1e18;

    function fund()public payable{ //para enviar eth la funcion tiene que ser declarada como payable
        //para obtener el valor que se esta enviando 1e18=1eth porq estan en wei
        //la palabra require lo convierte en un requisito que se debe cumplir
        //si no se cumple, se envia el mensaje y se deshacen la igualacion
        
        //number = 5;       //para demostrar que se deshace

        //require(msg.value >= 1e18, "Didnt send enough");    //se esta comprobando en ethereum

        require(getConversionRate(msg.value) >= minimumUsd, "Didnt send enough");

    }

    /*
        Es una funci√≥n que va a interactuar con otro contrato fuera de nuestro codigo
        este contrato va a ser el que almacena las funciones que se utilizan para obtener
        datos del nodo de chainlink. Por lo tanto, vamos a necesitar:
            -address
            -ABI (Application Binary Interface)
        del contrato con el que se interactua.
    
    */
    function getPrice()public view returns(uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        
        //hay que alocar una variable para todas las que devuelve la funcion de lastestRoundDate

        //(uint80 roundId, int price, uint startedAt, uint time, uint80 answeredInRound) = priceFeed.latestRoundData(); 

        //Pero solo nos interesa el precio entonces podemos eliminar el resto para no cargar el codigo
        //ETH in terms of USD

        (,int256 price,,,) = priceFeed.latestRoundData(); 
        return uint256(price * 1e10);
    }

    function getVersion() public view returns (uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return priceFeed.version();
    }

    function getConversionRate(uint256 ethAmount)public view returns (uint256){
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18; //always add and multiply before dividing
        return ethAmountInUsd;
    }

    //function withdraw(){}
}

